import React from "react";
import Categories from "../../components/Categories";
import DishCard from "../../components/DishBlock";
import Footer from "../../components/Footer";
import Header from "../../components/Header";

import "./Menu.css";

export const Menu = () => {
  return (
    <>
      <Header />
      <main>
        <section class="menu">
          <h1>Меню</h1>
          <div class="menu-grid">
            <Categories />
            <div class="right-side">
              <h1 class="choosed-category">Бургеры</h1>
              <div class="menu-products-grid">
                {[...Array(7)].map((_, index) => {
                  return <DishCard key={index} name={"Классический бургер"} />;
                })}
              </div>
            </div>
          </div>
        </section>
      </main>
      <Footer />
    </>
  );
};

export default Menu;
